import Isheader from "./components/Isheader";

function App() {
  return (
    <div className="main-home">
        <Isheader/>
        <div className="banner-sec min-h-screen bg-cover overflow-hidden" style={{backgroundImage: 'url(assets/images/banner-bg.jpg)'}}>
            <div className="md:flex items-center w-full">
                <div className="banner-left-caption md:w-1/2">
                  left
                </div>
                <div className="banner-right-pic md:w-1/2">
                  <figure>
                    <img src="assets/images/banner-img.png"/>
                  </figure>
                </div>
            </div>
        </div>
    </div>
  );
}

export default App;
